import React, { Component } from "react";
import Carousel from "react-elastic-carousel";
import "./App.css";
//import Desktop from "./Components/Desktop";
//import Card from "./Components/Card";
state = {
  items: [
    { id: 1, title: "item #1" },
    { id: 2, title: "item #2" },
    { id: 3, title: "item #3" },
    { id: 4, title: "item #4" },
    { id: 5, title: "item #5" },
  ],
};
function App() {
  const { items } = this.state;
  return (
    <Carousel>
      {items.map((item) => (
        <div key={item.id}>{item.title}</div>
      ))}
    </Carousel>
  );
}

export default App;
